import React from 'react';

const NewCard = ({New}) => {
    return (
        <>
            <div className={'newCard'}>
                <div className={'newCardImage'}>
                    <img src={New.urlToImage}/>
                </div>
                <div className={'newCardText'}>
                    <div className={'newCardTitle'}>
                        {New.title}

                    </div>
                    <div  className={'newCardDescription'}>
                        {New.description}
                    </div>
                </div>
                <div className={'publishedAt'}>
                    Опубликовано: {New.publishedAt}
                </div>
            </div>
        </>
    );
};

export default NewCard;
